DROP TABLE IF EXISTS `npc_element`;
CREATE TABLE `npc_element` (
  `id` int(11) unsigned NOT NULL DEFAULT '0',
  `AtkElement` tinyint(1) NOT NULL DEFAULT '-1',
  `elemAtkPower` int(11) NOT NULL DEFAULT '0',
  `FireRes` int(11) NOT NULL DEFAULT '0',
  `WaterRes` int(11) NOT NULL DEFAULT '0',
  `WindRes` int(11) NOT NULL DEFAULT '0',
  `EarthRes` int(11) NOT NULL DEFAULT '0',
  `HolyRes` int(11) NOT NULL DEFAULT '0',
  `DarkRes` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


